.
Antusias warga mulai ada ketika pengunjung Lubang Sewu Erorejo semakin banyak apalagi mendekati hari libur, ribuan wisatawan datang ke tempat ini untuk menikmati keindahan batu karangnya dan pemandangan waduk wadaslintang, tidak sedikit dari mereka berfoto ria dan menyebarkan keindahan lubang sewu ke media sosial.
.
Asal muasal nama lubang sewu berasal dari cerita masyarakat sekitar saat keadaan air surut kadang terlihat ribuan lubang dan batu yang terkikis oleh air seperti karang atau seperti grand canyon berukuran kecil dan indah, tempat wisata ini dikatakan destinasi musiman karena kadang bebatuan itu tenggelam saat musim hujan.
.
Lubang Sewu terletak di Desa Erorejo Kecamatan Wadaslintang Wonosobo tepatnya di area sekitar waduk Wadaslintang. Untuk menuju ke destinasi ini kalian pergi ke area perbatasan antara Wonosobo dan Kebumen. Untuk perjalanan dari Kota Wonosobo melewati arah Banjarnegara hingga sampai perempatan Sawangan, lalu melewati Kaliwiro dan menuju ke Wadaslintang, sudah terpampang jelas tulisan Desa Wisata Erorejo Lubang Sewu, jarak yang ditempuh jika melalui Wonosobo sekitar 43 km.
